1. Register HoloEasy api. @Override
public void onEnable() { HoloEasy.bind(plugin, PacketImpl.ProtocolLib /* PacketImpl.PacketEvents */ );
} 2. Define your first Hologram class. public class HelloWorldHologram extends Hologram { Line<String> line = textLine("Hello World"); public HelloWorldHologram(@NotNull Location location) { super(location); }
} 3. Now spawn a hologram. public void create(Location location) { HelloWorldHologram hologram = new HelloWorldHologram(location); hologram.show();
} 4. Congratulations! You have created your first Hologram.
